(1, 2, '', 'Fri, 11 Sep 2020 15:28:24 GMT', '2022-05-22T17:22:09+02:00', '5f5b7b78049be754e8276676', NULL, '4 tickets voor Familiepark Nienoord - Leukste uitje van Groningen!', '<p>Geniet bij Familiepark Nienoord van een dag vol speelplezier. Kom spelen in de grote speeltuin, ga uit je dak in de overdekte apenkooi, knuffel met de diertjes in de kinderboerderij en maak een ritje met de trein.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FLandgoed%20Nienoord%2FLandgoedNienoord-helicopters.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
