(57, 2, '', 'Fri, 21 Jan 2022 11:44:00 GMT', '2022-04-29T09:57:23+02:00', '61ea8e70093c2a80951bc83e', NULL, 'Havenrondvaart voor 2 personen met Amsterdam Boat Cruises incl. 12-uurtje!', '<p>Stap aan boord van de 2 uur durende havenrondvaart met Amsterdam Boat Cruises en beleef de Amsterdamse zeehaven van dichtbij onder het genot van een heerlijk 12 uurtje bestaande uit kopje soep, broodje kaas, broodje ham en kroket met mosterd.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FAmsterdam%20Boat%20Experience%2Fboot-3-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(58, 2, '', 'Mon, 01 Jan 0001 00:00:00 GMT', '2022-05-23T02:03:04+02:00', '5f0f9c0e62ccdf73583c9675', NULL, '2 tickets voor Jurassic Golf in Gouda!', '<p>Dino Experience Park heeft de meest avontuurlijke minigolfbaan van Nederland. Op de professionele 18-holes golfbaan speel je tussen levensechte dinoâ€™s, waardoor een balletje slaan een behoorlijk spektakel wordt.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FDino%20Experience%20Park%2Fdino-2-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(59, 2, '', 'Wed, 11 May 2022 15:03:14 GMT', '2022-05-20T19:36:22+02:00', '627bb412f8169c546019ee6b', NULL, '2 tickets voor Thermen & Wellness Anholts in Schoonebeek!', '<p>In het prachtige beekdal-landschap in Schoonebeek, in de gemeente Emmen ligt Thermen Welleness Anholts waar je een paar uur kan genieten van een welverdiende vakantie!Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%20vanaf%20mei%202022%2Fanholts-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(60, 2, '', 'Fri, 24 Sep 2021 11:56:20 GMT', '2022-05-08T00:30:11+02:00', '614da0c44a43079bd7575b4e', NULL, '2 tickets voor Luchtvaartmuseum Aviodrome!', '<p>Ontdek bij Luchtvaartmuseum Aviodrome een wereld vol avontuurlijke vliegtuigactie voor jong en oud. StapÂ aan boord van een Boeing 747, vlieg in een flightsimulator, test jouw Spykerharde zenuwen tijdens de 4D-film en nog veel meer.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2Faviodrome%2Faviodrome_Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(61, 2, '', 'Tue, 26 Jan 2021 15:55:19 GMT', '2022-05-20T21:48:20+02:00', '60102d57623b9757f8c04018', NULL, 'Leer de handigste manoeuvres met een heftige slipcursus!', '<p>Slippen, draaien op een glad wegdek en weer recht doorgaan. Om de auto te blijven beheersen is het noodzakelijk dat je leert waarom de auto zijn grip verliest, hoe je hierop kunt anticiperen en als het dan toch gebeurt, hoe je moet handelen!</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FSlipcursus%20Wens%2Fslip-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
