(161, 2, '', 'Mon, 21 Jun 2021 17:01:58 GMT', '2022-05-16T18:15:41+02:00', '60d0a9e684792432fced7889', NULL, '4 daags minivakantie arrangement bij Landgoed Overste Hof voor 2 personen!', '<p>Kom even helemaal tot rust tijdens een heerlijk 4 daags minivakantie arrangement bij Landgoed Overste Hof midden in de Limburgse natuur. Ga lekker wandelen of fietsen en geniet van de prachtige omgeving.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FLandgoed%20Overste%20Hof%2Flandgoed-3-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
