(163, 2, '', 'Mon, 21 Mar 2022 12:04:48 GMT', '2022-05-14T09:35:19+02:00', '62385bd0dc443a34e07f6940', NULL, '1 uur bowlen bij All American Bowling in Noordwijkerhout!', '<p>Geniet van 1 uur bowlen bij All American Bowling met je vrienden, familie of collega\'s. De baan is beschikbaar voor maximaal 6Â personen.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%2Fallamericanbowlen-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance');
