(167, 2, '', 'Tue, 10 Aug 2021 10:08:28 GMT', '2022-05-22T10:11:47+02:00', '611233fc268aea0c4880b1e5', NULL, '2 tickets voor Royal Delft Museum!', '<p>Ontdek de wereld van Royal Delft bij het Royal Delft Museum. Ontmoet de makers van Delfs Blauw en bewonder de historische collectie. Naast klassieke stukken zie je in de collectie ook hedendaagse decoraties.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FRoyal%20Delft%20Museum%2Froyal-delft-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
