(316, 2, '', 'Fri, 21 Jan 2022 09:51:00 GMT', '2022-05-21T14:45:42+02:00', '61ea73f4093c2a80951bc71f', NULL, 'Rondvaart vanuit Leiden-centrum met rederij van Hulst!', '<p>Deze meer dan 2 uur durende rondvaart met rederij van Hulst neemt je mee over de Kagerplassen. Vanuit het prachtige Leiden vaar je langs polders met koeien in de wei, poldereilandjes en historische molens.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FRederij%20van%20Hulst%2F2-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
