(323, 2, '', 'Thu, 21 Oct 2021 11:11:35 GMT', '2022-05-21T08:56:28+02:00', '61712ec7982ca62e1c23b711', NULL, '4 tickets voor Luchtvaartmuseum Aviodrome!', '<p>Ontdek bij Luchtvaartmuseum Aviodrome een wereld vol avontuurlijke vliegtuigactie voor jong en oud. StapÂ aan boord van een Boeing 747, vlieg in een flightsimulator, test jouw Spykerharde zenuwen tijdens de 4D-film en nog veel meer.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2Faviodrome%2Faviodrome-2-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(324, 2, '', 'Tue, 12 Apr 2022 13:55:43 GMT', '2022-05-18T08:01:14+02:00', '625568bfb14584e65c815151', NULL, 'Engelse sferen in de Hollandse tuin met deze set van 6 struikveronica\'s!', '<p>CreÃ«er een prachtige groene tuin met deze set van 6 winterharde Struikveronicaâ€™s (Hebe planten). Je hebt weinig omkijken naar de plant en hij krijgt prachtige gekleurde bloemen.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%20vanaf%20april%202022%2Fperfectplant-1-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(325, 2, '', 'Mon, 01 Jan 0001 00:00:00 GMT', '2022-05-16T11:54:56+02:00', '5f0f9c3862ccdf73583ca564', NULL, 'High Wine, Beer of Bubbles voor 2 bij Fletcher Hotels!', '<p>Geniet samen tijdens deÂ  High Wine of High Beer of High Bubbles van een goed glas wijn, luxe bubbles of een lekker speciaal biertje bij Ã©Ã©n van de mooie Fletcher Hotels.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FFletcher%20Hotel%20Exploitaties%2Ffletcher-5-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(326, 2, '', 'Thu, 31 Mar 2022 09:41:08 GMT', '2022-05-22T15:03:53+02:00', '62455b14cf6bc4baf6e53f24', NULL, '2 tickets voor de Tuinen van Appeltern!', '<p>De Tuinen van Appeltern is het grootste tuininspiratiepark van Nederland. Niet alleen bieden ze interessante informatie over tuinieren, tuinaanleg en tuintrends, ze bieden ook een gezellig dagje uit!Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%2Fappeltern-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(327, 2, '', 'Fri, 15 Apr 2022 15:47:03 GMT', '2022-05-20T01:00:00+02:00', '62597757750e11a076e37e08', NULL, '2 uur durende rondvaart inclusief barbecue diner in buffetvorm!', '<p>Geniet van een prachtige rondvaart op de Kempense Meren inclusief een uitgebreide barbecue in buffetvorm. Ondertussen leer jij alles over de omgeving van de ervaren kapitein.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%20vanaf%20april%202022%2Fdezander-3-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(328, 2, '', 'Wed, 20 Apr 2022 15:03:38 GMT', '2022-05-22T17:07:37+02:00', '626004aa55755f9311b35363', NULL, '2 tickets voor klimpark Adventure Valley Zoetermeer', '<p>Adventure Valley Zoetermeer beschikt over een geheel vernieuwd klimpark! Met 4 klimroutes tot wel 12 meter hoogte, meer dan 20 obstakels en 4 ziplines beleef jij avontuur op grote hoogte.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%20vanaf%20mei%202022%2Fadventure-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance');
