(329, 2, '', 'Thu, 21 Oct 2021 14:05:34 GMT', '2022-05-21T17:28:27+02:00', '6171578e982ca62e1c23b792', NULL, '2 tickets voor Bounce Valley Enschede!', '<p>Kom springen in het grootste Airpark van Nederland: Bounce Valley Enschede. Je vindt hier alles voor extreme fun: van wipe-out tot de bungee run en obstacle run. Er is echt van alles te doen tijdens je bezoek aan dit springkussenpark.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2Fbounce%20valley%20enschede%2F10-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(330, 2, '', 'Thu, 06 May 2021 12:14:47 GMT', '2022-05-20T15:26:03+02:00', '6093c1979cdd6c0ec449610d', NULL, '2 uur durende rondvaart over de Maas en de Maasplassen + oma\'s pannenkoek!', '<p>Maak een heerlijke boottochtÂ van 2 uur over de prachtigeÂ Maas en de Maasplassen en geniet tijdens de vaart van een lekkere pannenkoek. Je kunt kiezen uit een opstaplocatie in Maasbracht ofÂ Thorn.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%2Fcascade-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
