(332, 2, '', 'Wed, 04 Aug 2021 17:34:09 GMT', '2022-05-18T19:47:23+02:00', '610ab371f367850a64c4f147', NULL, '4 tickets voor het fotogenieke Youseum in Amsterdam!', '<p>Maak de meest bijzondere, gekke en tofste selfies in het museum die volledig draait om jou; het Youseum, Youseum bestaat uit 15 samengestelde ruimtes met meer dan 25 interactieve kunst- en lichtinstallaties.</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FYouseum%2Fyouseum-2-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(333, 2, '', 'Mon, 01 Jan 0001 00:00:00 GMT', '2022-05-20T16:09:33+02:00', '5f0f9c0a62ccdf73583c94cf', NULL, 'Spannende lasergame voor 4 personen bij Coronel!', '<p>Daag jouw vrienden uit in de Lasergame Arena! Beweeg je tussen de echte autowrakken en andere obstakels. Lukt het jou om binnen 12 minuten de meeste punten te halen?</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FCoronel%20Events%2Fcoronel-lasergamen-korting-tv_%282%29.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
