(488, 2, '', 'Wed, 22 Jul 2020 10:54:55 GMT', '2022-05-11T19:33:14+02:00', '5f17fedfff31d187183b05ba', NULL, 'Pimp je huis met jouw mooiste foto op canvas (40x60 cm) van Colorland!', '<p>Kale muren worden weer springlevend met deze haarscherpe canvasdoeken met foto\'s van jouw mooiste herinneringen! De canvasdoeken zijn beschikbaar in verschillende maten, dus er is voor iedere ruimte een geschikt formaat beschikbaar.Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FColorland%2FCanvas%2050%20x%2050%20en%2040%20x%2060%2Fcanvas_10.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
(489, 2, '', 'Tue, 10 May 2022 14:15:24 GMT', '2022-05-18T10:28:17+02:00', '627a575c0b29ac100ff6ea91', NULL, '2 tickets voor Zomer Heerlijckheid bij Kasteel Warmelo!', '<p>De gezelligheid van een sfeervolle buitenfair: van 15 t/m 17 juli 2022 vindt voor de tweede keer \'Zomer Heerlijckheid\' plaats op het betoverende Landgoed Warmelo te Diepenheim!Â </p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2FLogo%20vanaf%20mei%202022%2Fzomer-Website.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
