(497, 2, '', 'Thu, 02 Dec 2021 09:28:36 GMT', '2022-05-13T15:44:16+02:00', '61a883b45b335da4dc9b3c46', NULL, '1 CryoAir-gezichtsbehandeling bij Dr. Freeze Utrecht!', '<p>De CryoAir-gezichtsbehandeling bij Dr Freeze Utrecht is een effectieve en 100% natuurlijke detox behandeling speciaal voor het gezicht. Door de huid bloot te stellen aan een zeer lage temperatuur neemt jeÂ doorbloeding enorm toe waardoor afvalstoffen worden afgevoerd en je huid grondig wordt gereinigd!</p>', 'https://www.ticketveiling.nl/tickets/?tt=8308_1936537_46097_&r=https%3A%2F%2Fticketveiling.imgix.net%2Faanbieders%2FDr%20Freeze%2Fdr-freeze-cryoair-gezichtsbehandeling-korting-ticketveiling_%282%29.jpg%3Fq%3D70%26w%3D560%26h%3D300%26fit%3Dcrop%26auto%3Dcompress%2Cformat%2Cenhance'),
